import React from "react";
import "../Styles/Navbar.css";
import logo from "../img/-.png";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <nav>
      <Link to="/">
        <img src={logo} alt="" />
      </Link>
    </nav>
  );
};

export default Navbar;
